import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <div className="Background">
        <header className='Logo'>
          <p className='Logoimage'>.</p>
          <h2 className='logoname'>Yime</h2>
        </header>
      </div>
      <div className='LoginTitle'>
        <h1>Welcome</h1>
      </div>
    </div>
  );
}

export default App;
